var tipuesearch = {"pages": [{'title': 'About', 'text': '41023134 \n \n \n \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'w13', 'text': '\n \n', 'tags': '', 'url': 'w13.html'}, {'title': 'w14', 'text': '利用 Brython 在個人的網站上, 將程式存入 Gist, 從 舊資料 中刪除沒有在 註冊名單 中的內容, 完成後, 將個人網站的 w14 連結進行繳交. \n  導入 brython 程式庫  \n \n \n  啟動 Brython  \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["py_src"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  印出版次與關鍵字程式  \n \n \n \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  Filename:  .py    存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div 作為切入位置  \n \n  導入 gearUtils-0.9.js Cango 齒輪繪圖程式庫  \n \n \n \n \n \n \n', 'tags': '', 'url': 'w14.html'}, {'title': 'Tetris', 'text': '\n \n \n \n \n \n \n \n  Cango 程式庫  \n \n \n \n \n \n \n  for Konva 程式庫  \n \n \n \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["py_src"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  印出版次與關鍵字程式  \n \n \n \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n Filename:  .py   \n Run   Output   清除輸出區 清除繪圖區 Reload \n \n \n \n', 'tags': '', 'url': 'Tetris.html'}, {'title': 'midterm', 'text': '\n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'midterm.html'}, {'title': 'final', 'text': '\n week1    1.電腦輔助設計室 IPv6 網路設定    2.創建 wcm2022 倉儲    week2    1.無    week3    1.學習建立可攜系統    week4    1.討論同學倉儲為什麼無法添加 cmsimde    week5    1.無    week6    1.無    week7    1.學習如何設定 nginx    2.用 gpg4win 查看下載的檔案的數位簽證    week8    1.無    week9    1.期中考週。    2.期中考改為在 wink 影片添加註解並將影片放到個人網站。    week10    1.無 \n week11 \n 1.無 \n week12    1.建立虛擬主機 \n 2.在電腦輔助設計室設定伺服器 \n week13 \n 1.建立 Bython 環境，並加入 Tetris 遊戲。 \n 2.Tetris 線上遊戲專案報告 \n week14 \n 1.資料對比並將退選的同學資料刪除。 \n week15 \n 1.放假。 \n 2.將 Tetris 遊戲加入計分系統。 \n 3.Tetris 遊戲計分系統報告。 \n week16 \n 1.期末報告整理。 \n \n', 'tags': '', 'url': 'final.html'}, {'title': 'w17', 'text': '心得：這方塊掉落速度有點快，很難跟上，還好最後有拿到6分 \n', 'tags': '', 'url': 'w17.html'}]};